import { useDispatch } from "react-redux";
import { changePath } from "../store";

const navigate = (to) =>
{
    window.history.pushState({}, '', to);
}

function NavigateTo(path)
{
    const dispatch = useDispatch();

    navigate(path);
    dispatch(changePath(path));
}

export {NavigateTo};
